import React from 'react';
import styled from 'styled-components';

export default function Loading() {
  return (
    <LoadingContainer>
      <LoadingImage
        src="https://usagif.com/wp-content/uploads/loading-38.gif.webp"
        alt="Loading"
      />
    </LoadingContainer>
  );
}

  const LoadingContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
`;

const LoadingImage = styled.img`
  max-width: 100%;
`;
